import React, { Component } from 'react';
import { render } from "react-dom";
import { Chrono } from "react-chrono";
import { ThemeConsumer } from 'styled-components';

const items = [
    {
        title: "Apr 2021",
        cardTitle: "AfterClass Intern",
        cardSubtitle: "Frontend intern"
    },
    {
        title: "Jan 2021",
        cardTitle: "BIA Data Associate Programme"
    },
    {
        title: "Nov 2020",
        cardTitle: "Ellipsis Marketing"
    }
];

class NewTimeline extends Component {
    render() {
        return (
            <div style={{ width: "100%", height: "100%" }}>
            <Chrono
              items={items}
              mode="VERTICAL_ALTERNATING"
              hideControls="true"
              theme={{primary: "#cdcdcd", secondary: "none", cardBgColor: "#00011c", cardForeColor: "#cdcdcd" }}>
/</Chrono>>

          </div>
        );
    }
}

export default NewTimeline;
